        this.state = {
            quote: ''
        };
    }

    fetchQuote() {
        axios("https://api.kanye.rest/").then((response) => {
            console.log(response);
            console.log(response.data.quote);
            this.setState({})
        });
    }

    render () {
        return (
            <div>
                <h1>ProtoType</h1>
                <Quote />
                <Typer />
            </div>
        );
    };
};

export default ProtoType
